// import NavBar from "./Project/Navbar";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Sem4 from "./Papers/sem4/Home";

function CseRouters (){

    return(
      <div>
        <Router>
        <Routes>
          <Route path="/cse/1" element={<Sem4 />} />
          <Route path="/cse/2" element={<Sem4 />} />
          <Route path="/cse/3" element={<Sem4 />} />
          <Route path="/4" element={<Sem4 />} />
          <Route path="/cse/5" element={<Sem4 />} />
          <Route path="/cse/6" element={<Sem4 />} />
          <Route path="/cse/7" element={<Sem4 />} />
          <Route path="/cse/8" element={<Sem4 />} />
        </Routes>
      </Router>
      </div>
    )
};

export default CseRouters;
